Are y’all ready??!!

Let’s season our new 
@traegergrills Flatrock

We used coconut oil, for the high temp factor. 

We did 4 cycles of oil, burn off and repeat. 

Just watching the tiny smoke tornados burn off the oil, we could feel the heat!!

And of course for the first cook
Whitetail Deer Loin &
Beef Chateaubriand !!🔥🔥🥩🥩

Our favourite new word. EPIC!!!!!

Seared all sides of both loins with some EVOO at high temp, until a beautiful crust appeared. 

Then we removed them, wrapped them in Traeger butcher paper and finished them on our @traegergrills Ironwood grill. 

Took them off at 120 and let them sit for 15 minutes wrapped and covered with a towel. 

OMG….🤤🤤🤤🤤🤤🔥🔥🔥

