Thanksgiving is just around the corner!!

Let’s do some stuffing!!!

You can make your own croutons/breadcrumbs like I did here on my @traegergrills Timberline Xl or buy some or start with a store bought box of Stuffing mix. 

The @traegergrills Flatrock is the rockstar here. 
Grilled up onions, garlic, celery, apples and cranberries on butter. Added all my favorite seasoning. Toasted up my croutons in butter, EVOO and seasonings. 

It can’t get any easier!!!
